
const witcat_fps_picture = "data:image/png;base64,";

const witcat_fps_icon = "data:image/png;base64,";

const witcat_fps_extensionId = "WitCatFPS";

/** @typedef {string|number|boolean} SCarg 来自Scratch圆形框的参数，虽然这个框可能只能输入数字，但是可以放入变量，因此有可能获得数字、布尔和文本（极端情况下还有 null 或 undefined，需要同时处理 */

class WitCatFPS {
    constructor(runtime) {
        this.runtime = runtime;
        /** Scratch fps 开关 */
        this.scfpson = false;
        /** Scratch fps(每秒更新) */
        this.scfps = 0;
        /** Scratch fps(随时更新) */
        this.scfpsn = 0;
        /** Scratch fps 计数 */
        this.scfpscnt = 0;
        /** Scratch fps 每秒 setInterval 计时器 */
        this.scfpsinterval = -1;
        /** Scratch fps 上一帧时间(计算瞬时fps) */
        this.scfpstime = 0;

        /** 浏览器 fps 开关 */
        this.webfpson = false;
        /** 浏览器 fps(每秒更新) */
        this.webfps = 0;
        /** 浏览器 fps(随时更新) */
        this.webfpsn = 0;
        /** 浏览器 fps 计数 */
        this.webfpscnt = 0;
        /** 浏览器 fps 计数函数已经关闭？ */
        this.webfpstick_end = true;
        /** 浏览器 fps 上一帧时间(计算瞬时fps) */
        this.webfpstime = 0;
        /** 浏览器 fps 每秒更新 setInterval 计时器 */
        this.webfpsinterval = -1;


        /** 被挂钩的 runtime._step 函数 */
        this.step = this.runtime._step;
        this._formatMessage = runtime.getFormatMessage({
            "zh-cn": {
                "WitCatFPS.name": "[beta]白猫的FPS",
                "WitCatFPS.webs": "浏览器",
                "WitCatFPS.scratchs": "舞台",
                "WitCatFPS.more": "更多",
                "WitCatFPS.scratch": "舞台FPS",
                "WitCatFPS.web": "浏览器FPS",
                "WitCatFPS.nscratch": "瞬时舞台FPS",
                "WitCatFPS.nweb": "瞬时浏览器FPS",
                "WitCatFPS.turnon": "[type]舞台FPS检测",
                "WitCatFPS.webturnon": "[type]浏览器FPS检测",
                "WitCatFPS.type.1": "开启",
                "WitCatFPS.type.2": "关闭",
                "WitCatFPS.docs": "📖拓展教程",
                "WitCatFPS.compute": "在帧率[fps]下的[num]",
            },
            en: {
                "WitCatFPS.name": "[beta]WitCat’s FPS",
                "WitCatFPS.webs": "web",
                "WitCatFPS.scratchs": "stage",
                "WitCatFPS.more": "more",
                "WitCatFPS.scratch": "stage FPS",
                "WitCatFPS.web": "web FPS",
                "WitCatFPS.nscratch": "stage current FPS",
                "WitCatFPS.nweb": "web current FPS",
                "WitCatFPS.turnon": "[type]stage FPS detection",
                "WitCatFPS.webturnon": "[type]web FPS detection",
                "WitCatFPS.type.1": "enable",
                "WitCatFPS.type.2": "disable",
                "WitCatFPS.docs": "📖 Tutorial",
                "WitCatFPS.compute": "the number[num]from[fps]",
            }
        })
    }

    /**
     * 翻译
     * @param {string} id
     * @return {string}
     */
    formatMessage(id) {
        return this._formatMessage({
            id,
            default: id,
            description: id
        });
    }

    getInfo() {
        return {
            id: witcat_fps_extensionId, // 拓展id
            name: this.formatMessage("WitCatFPS.name"), // 拓展名
            blockIconURI: witcat_fps_icon,
            menuIconURI: witcat_fps_icon,
            color1: "#EC3838",
            color2: "#B32B2B",
            blocks: [
                {
                    blockType: "button",
                    text: this.formatMessage('WitCatFPS.docs'),
                    onClick: this.docs,
                },
                "---" + this.formatMessage("WitCatFPS.scratchs"),
                {
                    opcode: "scratch",
                    blockType: "reporter",
                    text: this.formatMessage("WitCatFPS.scratch"),
                    arguments: {},
                },
                {
                    opcode: "nscratch",
                    blockType: "reporter",
                    text: this.formatMessage("WitCatFPS.nscratch"),
                    arguments: {},
                },
                {
                    opcode: "turnon",
                    blockType: "command",
                    text: this.formatMessage("WitCatFPS.turnon"),
                    arguments: {
                        type: {
                            type: "string",
                            menu: 'type',
                        }
                    },
                },
                "---" + this.formatMessage("WitCatFPS.webs"),
                {
                    opcode: "web",
                    blockType: "reporter",
                    text: this.formatMessage("WitCatFPS.web"),
                    arguments: {},
                },
                {
                    opcode: "nweb",
                    blockType: "reporter",
                    text: this.formatMessage("WitCatFPS.nweb"),
                    arguments: {},
                },
                {
                    opcode: "webturnon",
                    blockType: "command",
                    text: this.formatMessage("WitCatFPS.webturnon"),
                    arguments: {
                        type: {
                            type: "string",
                            menu: 'type',
                        }
                    },
                },
                "---" + this.formatMessage("WitCatFPS.more"),
                {
                    opcode: "compute",
                    blockType: "reporter",
                    text: this.formatMessage("WitCatFPS.compute"),
                    arguments: {
                        fps: {
                            type: "number",
                            defaultValue: '30',
                        },
                        num: {
                            type: "number",
                            defaultValue: '5',
                        }
                    },
                },
            ],
            menus: {
                type: [
                    {
                        text: this.formatMessage('WitCatFPS.type.1'),
                        value: 'true'
                    },
                    {
                        text: this.formatMessage('WitCatFPS.type.2'),
                        value: 'false'
                    },
                ],
            },
        };
    }

    /** 打开教程 */
    docs() {
        let a = document.createElement('a');
        a.href = "https://www.ccw.site/post/d6d96e80-3f58-4a19-b7e6-c567d3a6a583";
        a.rel = "noopener noreferrer";
        a.target = "_blank";
        a.click();
    }

    /**
     * 获取浏览器帧率用的回调函数
     * @param {DOMHighResTimeStamp} timestamp
     * @returns {void}
     */
    _webfpstick(timestamp) {
        // 存在多次开关功能导致该函数大量触发的情况。
        // 这样子设计，每帧只触发一次
        // 这里判断 webfpson 是否为真来判断是否要继续更新帧数，
        // 这样才能正常关闭。
        if (this.webfpson) {
            this.webfpstick_end = false;
            this.webfpscnt++;
            this.webfpsn = 1000 / (timestamp - this.webfpstime);
            this.webfpstime = timestamp;
            // 这里的 bind(this) 非常重要，让回调的时候 this 指向当前的 this。
            requestAnimationFrame(this._webfpstick.bind(this));
        }
        else {
            this.webfpstick_end = true;
        }
    }

    /**
     * 舞台的帧率
     * @return {number}
     */
    scratch() {
        return this.scfps;
    }

    /**
     * 舞台的瞬时帧率
     * @return {number}
     */
    nscratch() {
        return this.scfpsn;
    }

    /**
     * 浏览器的帧率
     * @return {number}
     */
    web() {
        return this.webfps;
    }

    /**
     * 浏览器的瞬时帧率
     * @return {number}
     */
    nweb() {
        return this.webfpsn;
    }

    /**
     * 设置舞台帧率检测
     * @param {object} args
     * @param {SCarg|"true"|"false"} args.type
     * @return {void}
     */
    turnon(args) {
        if (args.type == "true") {
            if (this.scfpson == false) {
                this.scfpson = true;
                this.scfpstime = Date.now();
                let that = this;
                this.runtime._step = function () {
                    if (that.scfpson) {
                        that.step.call(this);
                        let timestamp = Date.now();
                        that.scfpsn = 1000 / (timestamp - that.scfpstime);
                        that.scfpstime = timestamp;
                        that.scfpscnt++;
                    }
                }
                this.scfpsinterval = setInterval(() => {
                    this.scfps = this.scfpscnt;
                    this.scfpscnt = 0;
                }, 1000)
            }
        }
        else {
            if (this.scfpson == true) {
                this.scfpson = false;
                this.runtime._step = this.step;
                clearInterval(this.scfpsinterval);
                this.scfps = 0;
                this.scfpsn = 0;
            }
        }
    }

    /**
     * 设置浏览器帧率检测
     * @param {object} args
     * @param {SCarg|"true"|"false"} args.type
     * @return {void}
     */
    webturnon(args) {
        if (args.type == "true") {
            if (this.webfpson == false) {
                this.webfpson = true;
                this.webfpstime = Date.now();
                if (this.webfpstick_end) {
                    // 这里的 bind(this) 非常重要，让回调的时候 this 指向当前的 this。
                    requestAnimationFrame(this._webfpstick.bind(this));
                }
                this.webfpsinterval = setInterval(() => {
                    this.webfps = this.webfpscnt;
                    this.webfpscnt = 0;
                }, 1000)
            }
        }
        else {
            if (this.webfpson == true) {
                this.webfpson = false;
                clearInterval(this.webfpsinterval);
                this.webfps = 0;
                this.webfpsn = 0;
            }
        }
    }
    /**
     * @param {number} fps 对照帧率
     * @param {number} num 需要计算的值
     * @return {number}
     */
    compute(args) {
        return Number(args.num) / (this.scfpsn / Number(args.fps));
    }
}

window.tempExt = {
    Extension: WitCatFPS,
    info: {
        name: "WitCatFPS.name",
        description: "WitCatFPS.descp",
        extensionId: witcat_fps_extensionId,
        iconURL: witcat_fps_picture,
        insetIconURL: witcat_fps_icon,
        featured: true,
        disabled: false,
        collaborator: "白猫 @ CCW"
    },
    l10n: {
        "zh-cn": {
            "WitCatFPS.name": "[beta]白猫的FPS",
            "WitCatFPS.descp": "运行速度！！！"
        },
        en: {
            "WitCatFPS.name": "[beta]WitCat’s FPS",
            "WitCatFPS.descp": "Detect running speed!!!"
        }
    }
};
